FeedPackage.ReleaseNotes:
1. No longer made preprocessing of country conditional expressions;
2. Added support of Autoprefixer version 6.3.1;
3. In configuration settings of Autoprefixer-postprocessor was added 4 new properties: `Supports` (default `true`), `Flexbox` (default `true`), `Grid` (default `true`) and `Stats` (default `empty string`).

1. Added support of Autoprefixer version 6.3.3.1;
2. No longer made preprocessing of country conditional expressions;
3. In configuration settings of Autoprefixer-postprocessor was added 4 new properties: `Supports` (default `true`), `Flexbox` (default `true`), `Grid` (default `true`) and `Stats` (default `empty string`).

1. Added support of Clean-css version 4.1.1;
2. In level 1 optimization settings was added one new property - `RemoveEmpty` (default `true`);
3. In level 2 optimization settings was added three new properties: `RemoveEmpty` (default `true`), `RemoveUnusedAtRules` (default `false`) and `SkipProperties` (default empty string).

1. Added the ability to specify the externs files;
2. In configuration settings of Closure Remote JS-minifier was added 3 new properties: `Charset` (default is empty), `Language` (default `EcmaScript3`) and `UseTypesForOptimization` (default `false`);
3. In configuration settings of Closure Local JS-minifier was renamed one property - `LanguageSpec` to `LanguageInput`, and added 16 new properties: `AcceptConstKeyword` (default `false`), `AllowEs6Output` (default `false`), `AngularPass` (default `false`), `Charset` (default is empty), `DefinitionList` (default is empty), `ErrorList` (default is empty), `ExportLocalPropertyDefinitions` (default `false`), `ExtraAnnotationNameList` (default is empty), `GenerateExports` (default `false`), `LanguageOutput` (default `None`), `SingleQuotes` (default `false`), `TranspileOnly` (default `false`), `TurnOffWarningClassList` (default is empty), `UseOnlyCustomExterns` (default `false`), `UseTypesForOptimization` (default `false`) and `WarningList` (default is empty).

Added support of IntelliSense when editing settings of Bundle Transformer in the Web.config file;
From the Web.config file has been removed settings of Bundle Transformer, which are default settings;
In list of JS-files with Microsoft-style extensions appeared wildcard for version number of JS-library.
